import VueRouter from 'vue-router'
//引入组件
import music from '../pages/MusicP'
import food from '../pages/FoodP'
import news from '../pages/NewsP'
import sport from '../pages/SportP'
import game from '../pages/GamesP'

//创建并暴露一个路由器
export default new VueRouter({
	routes:[
		{
			path:'/food',
			component:food
		},
		{
			path:'/music',
			component:music,
			
		}
	]
})
